import React from 'react';
import { Switch , Route, Redirect } from 'react-router-dom';
import Home from './pages/Home';
import Contact from './pages/Contact';
import Projets, { Projet1, Projet2, Projet3, Projet4 } from './pages/Projets';

const App = () => {
  return (
    <Switch>
      <Route exact path="/" component={Home} />
      <Route exact path="/projet1" component={Projet1} />
      <Route exact path="/projet2" component={Projet2} />
      <Route exact path="/projet3" component={Projet3} />
      <Route exact path="/projet4" component={Projet4} />
      <Route exact path="/contact" component={Contact} />
      <Redirect to="/" />


    </Switch>

  );
};

export default App;
